import React from "react";

const GroceryItem = (props) => {
  const { row, index } = props;
  return (
    <div key={index}>
      <td>{row.place}</td>
      <td>{row.amount}</td>
    </div>
  );
};

const Groceries = (props) => {
  const rows = props.groceries.map((row, index) => {
    return <GroceryItem row={row} key={index} />;
  });
  return <tr>{rows}</tr>;
};

export default Groceries;
